import React from "react";

function Button(props) {
  const { btnType } = props;

  return (
    <>
      <button
      id={props.id}
        className={`btn-${btnType}`}
        onClick={(event) => {
          event.preventDefault();
          props.onClick(event);
        }}

      >
        {btnType}
      </button>
    </>
  );
}

export default Button;
